import { anthropic } from '@ai-sdk/anthropic';
import { CoreMessage, streamText } from 'ai';
import { NextRequest } from 'next/server';

import { env } from 'process';
import { ProxyAgent, setGlobalDispatcher } from 'undici'; // ref: https://stackoverflow.com/a/76503362/9422455

// ref: https://stackoverflow.com/a/76503362/9422455
if (env.HTTP_PROXY) {
  // Corporate proxy uses CA not in undici's certificate store
  process.env.NODE_TLS_REJECT_UNAUTHORIZED = '0';
  const uri = new URL(env.HTTP_PROXY).toString();
  console.log({ uri });
  const dispatcher = new ProxyAgent({
    uri,
  });
  setGlobalDispatcher(dispatcher);
}

/**
 * This handler initializes and calls a simple chain with a prompt,
 * chat model, and output parser. See the docs for more information:
 *
 * https://js.langchain.com/docs/guides/expression_language/cookbook#prompttemplate--llm--outputparser
 */
export async function POST(req: NextRequest) {
  console.log('-- received chat request');
  const { messages }: { messages: CoreMessage[] } = await req.json();
  console.log({ messages });

  const result = await streamText({
    // model: anthropic('claude-3-haiku-20240307'),
    model: anthropic('claude-3-5-sonnet-20240620'),
    system: `
我将给你看几张图片，它们是一名天才建筑设计师的平面作品，她擅长图形化表达思考，设计里主要是简约的线条，并带有强烈的明暗对比，最终完美地表达其图形下方文字的内涵。

接着我将输入一个人的信息给你，它可能是一个人名，或者包含一些基本信息。

你首先是一位得道高僧，擅长古文解名，【一步步思考】为该人生成一首【独一无二的、押韵的、充满禅意、富有哲理的诗偈】。

接着仿照刚刚的设计师风格，基于对该姓名和诗偈的理解，【一步步思考】为该人生成一张【独一无二的人生图腾】，这个将作为 TA 的朋友圈封面，所以非常重要。

## 画面要求 

### 硬性要求
- 背景纯黑
- 禁止动画

### 创意要求 
- 极简主义（善用线条、基本图形、画面干净） 
- 设计美感、高级感、专业（善用粗细、透明度变化）

### 内容要求
- 生成的诗偈以优美的小字（繁体）镌刻在整张图的下半部分 
- 下方10%的区域是脚注，字体要小，右下角标注 “@XXX”（XXX是对方的名字） 

## 输出要求
- 使用 SVG (Viewbox="0 0 480 640") 输出目标图形，无需回复其他文本内容
`,
    messages: [
      {
        role: 'user',
        content: [
          // yoyo-1
          {
            type: 'image',
            image:
              '\n',
          },
          // yoyo-4
          {
            type: 'image',
            image:
              '\n',
          },
          // yoyo-7
          {
            type: 'image',
            image:
              '\n',
          },
        ],
      },
      ...messages,
    ],
  });

  // todo: block
  // // ref: https://sdk.vercel.ai/docs/getting-started/nodejs
  // let fullResponse = '';
  // process.stdout.write('\nAssistant: ');
  // for await (const delta of result.textStream) {
  //   fullResponse += delta;
  //   process.stdout.write(delta);
  // }
  // process.stdout.write('\n\n');

  return result.toDataStreamResponse();
}
